script: |
  super -f text -I q805.spq > q805.out

inputs:
  - name: q805.spq
    data: |
      SELECT (a+b+c+d+e)/5
      FROM t1 (FORMAT parquet)
      WHERE d NOT BETWEEN 110 AND 150
      AND (e>a AND e<b)
      AND e+d BETWEEN a+b-10 AND c+130
      ORDER BY 1;
  - name: t1

outputs:
  - name: q805.out
    data: |
